import './App_copy.css';
import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Link, Route, Switch } from "react-router-dom";
import { Button, DatePicker, version, message, Avatar, Image, Card } from "antd";
import "antd/dist/antd.css";
import zhCN from 'antd/lib/locale/zh_CN';
import moment from 'moment';
import 'moment/locale/zh-cn';
import { UserOutlined } from '@ant-design/icons';
const { Meta } = Card;

moment.locale('zh-cn');




class Routrcs extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      isActivename: "top_active"
    }
  }

  Glactive = () => {

  }
  render() {
    return (

      <ul className="top_qh">
        <li className="">
          <Link to='/'><Button type="primary">卡片视图</Button></Link>
        </li>
        <li className="">
          <Link to='/login'><Button type="primary">列表视图</Button></Link>
        </li>
        {/* <li className="">
          <Link to='/info'>田园</Link>
        </li> */}
      </ul>

    )
  }
}


class Info extends React.Component {
  constructor(props) {
    super(props)
  }

  render() {
    return (
      <div>sssss</div>

    )
  }
}

class Login extends React.Component {
  constructor(props) {
    super(props)
  }

  render() {
    return (
      <div>aaaa</div>


    )
  }
}

class Content1 extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      itemList: [],
      itemList1: []
    }

  }
  componentWillMount = () => {
    let _this = this
    window.window.uyun.env = 'prod';
    window.window.uyun.api.authenticateMobileUser('17596576465', 'wangbo1358', function (err, result1) {
      window.window.uyun.api.getDesigns({}, (err, result) => {
        /* console.log(err) */
        console.log(result.data)
        console.log(result1);
        _this.setState({
          itemList: result && result.data,
          itemList1: result1
        })
        // this.setState({
        //   itemList: result.data
        // })
      })
      window.window.uyun.util.setToken(result1.token);
    });
  }

  render() {
    return (

      <ul>
        <li>
          <Card
            hoverable
            style={{ width: 240 }}
            cover={<img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}
          >
            <Meta title="Europe Street beat" description="www.instagram.com" />
          </Card>
        </li>
      </ul>

    )
  }
}


class AppCopy extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      itemList: [],
      itemList1: []
    }

  }
  componentWillMount = () => {
    let _this = this
    window.window.uyun.env = 'prod';
    window.window.uyun.api.authenticateMobileUser('17596576465', 'wangbo1358', function (err, result1) {

      // App(result);
      /* _this.setState({
        itemList1: result1
      }) */

      window.window.uyun.api.getDesigns({}, (err, result) => {
        /* console.log(err) */
        console.log(result.data)
        console.log(result1);
        _this.setState({
          itemList: result && result.data,
          itemList1: result1
        })
        // this.setState({
        //   itemList: result.data
        // })
      })
      window.window.uyun.util.setToken(result1.token);
    });
  }
  time = (date) => {
    console.log("ss")
    let json_date = new Date(date).toJSON();
    return new Date(new Date(json_date) + 8 * 3600 * 1000).toISOString().replace(/T/g, ' ').replace(/\.[\d]{3}Z/, '')
  }
  remove = (index) => {
    this.state.itemList.slice(index, 1)
  }
  render() {
    return (

      <Router>

        <div className="App" >




          <header className="App-header">

            <div className="top_t">
              <div className="top_tl">{this.state.itemList1.displayname}的个人空间</div>
              <div className="top_tr">
                {/* <img src={this.state.itemList1.headimgurl}  /> */}
                <Avatar className="avarar1" src={this.state.itemList1.headimgurl} />{this.state.itemList1.displayname}
              </div>
            </div>



            <div className="top_title clearfix">
              <div className="title_left tit">
                <a className="App-link" href="javascript:;">&nbsp;BIM</a>

              </div>
              <div className="title_middle tit">设计列表</div>
              <div className="title_right tit"></div>
            </div>
            <div className="qh">
              <Routrcs />
            </div>
            <ul className="top_ul clearfix">
              <li>所有</li>
              <li>现代</li>
              <li>田园</li>
              <li>欧式</li>
              <li>美式</li>
              <li>中式</li>
              <li>日式</li>
              <li>北欧</li>
              <li>地中海</li>
              <li>东南亚</li>
              <li>简欧</li>
              <li>工业风</li>
              <li>简欧</li>
              <li>工业风</li>
              <li>...</li>
            </ul>
          </header>
          <div className="content">
            <Switch>

              <Route path="/" exact component={Content1}>

              </Route>
              <Route path="/login" component={Login}>

              </Route>
              <Route path="/info" component={Info}>

              </Route>

            </Switch>
          </div>
        </div>

      </Router>

    );
  }
}

export default AppCopy;
/* export default Routrcs; */
